def my_func(expression: str) -> bool:
    # Helper function to evaluate a simple expression with two operands and one operator
    def evaluate(a, op, b):
        if op == '&':
            return a and b
        elif op == '|':
            return a or b
        else:
            raise ValueError("Invalid operator")

    # Convert the string expression into a list of tokens
    tokens = []
    i = 0
    while i < len(expression):
        if expression[i] in 'tf':
            tokens.append(expression[i] == 't')
        elif expression[i] in '&|':
            tokens.append(expression[i])
        i += 1

    # First pass to evaluate all '&' operations
    stack = []
    i = 0
    while i < len(tokens):
        if isinstance(tokens[i], bool):
            stack.append(tokens[i])
        elif tokens[i] == '&':
            # Evaluate '&' with the previous value in the stack
            prev_value = stack.pop()
            next_value = tokens[i + 1]
            stack.append(evaluate(prev_value, '&', next_value))
            i += 1  # Skip the next value as it has been processed
        else:
            stack.append(tokens[i])
        i += 1

    # Second pass to evaluate all '|' operations
    result = stack[0]
    i = 1
    while i < len(stack):
        if stack[i] == '|':
            result = evaluate(result, '|', stack[i + 1])
            i += 1  # Skip the next value as it has been processed
        i += 1

    return result

# Example usage:
print(my_func("f|t&f&f|f&f|f&f&t|t"))  # Output: True
print(my_func("f&t|f&f"))  # Output: False
